import React, { Component } from 'react';

class Bio extends Component {


  render() {
    var wrapperBase = "bio-wrapper"
    var blockBase = "bio-section"
    var wrapper = "";
    var block = ""

    if(this.props.theme){
      wrapper = wrapperBase+ '-light'
      block = blockBase+ '-light'
    }
    else{
      wrapper = wrapperBase+ '-dark'
      block = blockBase+ '-dark'
    }

    return (


      <div className={wrapper}>
        <h3 style={this.props.style}> </h3>     
        <div className={block}>
        <h3> Hello! </h3>     
        Hello! My name is Madison & I am a Computer Science student at the University of Florida. I have previously interned at Ultimate Software (Weston, FL) for Summer 2019. I am currently seeking another internship opportunity for Summer of 2020.
        I am extremely passionate about tech's capability to serve those who are disadvantaged at any level. Below you'll be able to see my most recent resume that I hope to expound upon in the near future.
        </div>


      </div>
    );
  }


}



 export default Bio;
